import { Route,Redirect } from "react-router-dom";

function Private({auth,component: Component,...rest}){
    return(
        <Route {...rest} render={(props)=>{
            if(auth) 
            return <component {...props}/>
            else
            return <Redirect to='/'/>

        }} />
    )
}

export default Private;
